import React, { useContext, useState } from "react";
import { AuthContext } from "../context/AuthContext";
import { ProgressContext } from "../context/ProgressContext";
import { LogOut, User, Menu, X, Award } from "lucide-react";

const Navbar = () => {
  const { user, logout } = useContext(AuthContext);
  const { getOverallProgress } = useContext(ProgressContext);
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  // Calculate total problems (you'll pass this from parent later)
  const totalProblems = 50; // Placeholder
  const overallProgress = getOverallProgress(totalProblems);

  return (
    <nav className="glass-effect sticky top-0 z-50 border-b border-white/10">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex items-center justify-between h-16">
          {/* Logo */}
          <div className="flex items-center space-x-3">
            <div className="w-10 h-10 bg-gradient-to-br from-primary-500 to-purple-600 rounded-lg flex items-center justify-center shadow-lg">
              <Award className="w-6 h-6 text-white" />
            </div>
            <div>
              <h1 className="text-xl font-bold bg-gradient-to-r from-primary-400 to-purple-400 bg-clip-text">
                DSA Mastery
              </h1>
              <p className="text-xs text-gray-400">Code. Learn. Grow.</p>
            </div>
          </div>

          {/* Desktop Menu */}
          <div className="hidden md:flex items-center space-x-6">
            {/* Progress Badge */}
            <div className="flex items-center space-x-2 bg-white/5 px-4 py-2 rounded-lg border border-white/10">
              <div className="w-2 h-2 bg-green-400 rounded-full animate-pulse"></div>
              <span className="text-sm text-gray-300">
                Progress:{" "}
                <span className="font-bold text-primary-400">
                  {overallProgress}%
                </span>
              </span>
            </div>

            {/* User Info */}
            <div className="flex items-center space-x-3">
              <div className="w-9 h-9 bg-gradient-to-br from-blue-500 to-purple-600 rounded-full flex items-center justify-center">
                <User className="w-5 h-5 text-white" />
              </div>
              <div className="text-left">
                <p className="text-sm font-semibold text-gray-200">
                  {user?.name}
                </p>
                <p className="text-xs text-gray-400">{user?.email}</p>
              </div>
            </div>

            {/* Logout Button */}
            <button
              onClick={logout}
              className="flex items-center space-x-2 px-4 py-2 bg-red-500/10 hover:bg-red-500/20 text-red-400 rounded-lg transition-all duration-300 border border-red-500/30"
            >
              <LogOut className="w-4 h-4" />
              <span className="text-sm font-medium">Logout</span>
            </button>
          </div>

          {/* Mobile Menu Button */}
          <button
            onClick={() => setIsMenuOpen(!isMenuOpen)}
            className="md:hidden p-2 rounded-lg bg-white/5 hover:bg-white/10 transition-colors"
          >
            {isMenuOpen ? (
              <X className="w-6 h-6" />
            ) : (
              <Menu className="w-6 h-6" />
            )}
          </button>
        </div>

        {/* Mobile Menu */}
        {isMenuOpen && (
          <div className="md:hidden pb-4 animate-slide-in">
            <div className="space-y-3">
              <div className="bg-white/5 p-3 rounded-lg border border-white/10">
                <p className="text-sm text-gray-400">Progress</p>
                <p className="text-lg font-bold text-primary-400">
                  {overallProgress}%
                </p>
              </div>
              <div className="bg-white/5 p-3 rounded-lg border border-white/10">
                <p className="text-sm text-gray-400">Logged in as</p>
                <p className="text-sm font-semibold">{user?.name}</p>
              </div>
              <button
                onClick={logout}
                className="w-full flex items-center justify-center space-x-2 px-4 py-3 bg-red-500/10 text-red-400 rounded-lg border border-red-500/30"
              >
                <LogOut className="w-4 h-4" />
                <span>Logout</span>
              </button>
            </div>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
